    "Course team members with the Admin role help you manage your course. They can do all of the tasks that Staff can do, and can also add and remove the Staff and Admin roles, discussion moderation roles, and the beta tester role to manage course team membership. You can only give course team roles to enrolled users.": "Les membres de l'\u00e9quipe avec le r\u00f4le Admin aident \u00e0 la gestion du cours. Ils peuvent \u00e9galement effectuer toutes les actions comme l'\u00c9quipe p\u00e9dagogique, mais aussi ajouter ou supprimer des membres Admin, g\u00e9rer les r\u00f4les de mod\u00e9rations des forums, l'ajout de b\u00eata-testeurs. Vous ne pouvez affecter des r\u00f4les que pour les utilisateurs inscrits au cours.", 
