    "Defines the number of points each problem is worth. If the value is not set, each response field in the problem is worth one point.": "D\u00e9finit le nombre de points attribu\u00e9s \u00e0 chaque probl\u00e8me. Si la valeur n'est pas d\u00e9finie, chaque champ de r\u00e9ponse du probl\u00e8me vaut un point.", 
    "Defines the number of times a student can try to answer this problem. If the value is not set, infinite attempts are allowed.": "D\u00e9finit le nombre de fois qu'un \u00e9tudiant peut essayer de r\u00e9pondre au probl\u00e8me. Si aucune valeur n'est pr\u00e9cis\u00e9e, un nombre infini d'essais est autoris\u00e9.", 
    "Defines when to randomize the variables specified in the associated Python script. For problems that do not randomize values, specify \"Never\". ": "D\u00e9finit quand les variables sp\u00e9cifi\u00e9es dans le script Python associ\u00e9 doivent \u00eatre choisies de mani\u00e8re al\u00e9atoire. Pour les exercices dont les valeurs ne sont pas al\u00e9atoires, sp\u00e9cifiez \"Never\".", 
