    "Each content group that you create can be associated with one or more cohorts. In addition to course content that is intended for all students, you can designate some content as visible only to specified content groups. Only learners in the cohorts that are associated with the specified content groups see the additional content.": "Chaque groupe de contenu que vous cr\u00e9er peut \u00eatre associ\u00e9 \u00e0 une ou plusieurs cohortes. En plus du contenu de cours qui est pr\u00e9vu pour tous les \u00e9tudiants, vous pouvez d\u00e9signer une partie du contenu visible uniquement \u00e0 des groupes de contenu sp\u00e9cifiques.Seuls les apprenants dans les cohortes qui sont associ\u00e9es \u00e0 des groupes de contenu sp\u00e9cifiques verront ce contenu additionnel.", 
    "Each line is a comma-separated list. The first item in each line is the slug of a badge class you have created that has an issuing component of 'openedx__course'. The remaining items in each line are the course keys the learner needs to complete to be awarded the badge. For example: slug_for_compsci_courses_group_badge,course-v1:CompSci+Course+First,course-v1:CompsSci+Course+Second": "Chaque ligne est liste s\u00e9par\u00e9e par des virgules. Le premier item sur chaque ligne est le slug de slug de la classe de badge que vous avez cr\u00e9\u00e9 qui attribue le composant 'openedx__course'. Les autres items sur chaque ligne sont les cl\u00e9s de cours que l'apprenant doit compl\u00e9ter afin de se voir attribuer le badge. Par exemple: slug_for_compsci_courses_group_badge,course-v1:CompSci+Course+First,course-v1:CompsSci+Course+Second", 
    "Each revision contains a title field that must be filled out, even if the title has not changed": "Chaque r\u00e9vision contient un champ \"titre\" qui doit \u00eatre rempli, m\u00eame si le titre n'a pas \u00e9t\u00e9 modifi\u00e9", 
    "Each video file that you upload needs to reach the video processing servers successfully before additional work can begin. You can monitor the progress of files as they upload, and try again if the upload fails.": "Les fichiers vid\u00e9os charg\u00e9s doivent \u00eatre correctement trait\u00e9s par les serveurs de traitement vid\u00e9o avant de pouvoir continuer les autres manipulations. Vous pouvez surveiller le progr\u00e8s de chargement des fichiers et recommencer si le chargement \u00e9choue.", 
    "Earned %(created)s.": "%(created)s obtenus.", 
    "Ed. Completed": "Ed. Termin\u00e9", 
    "EdX Financial Assistance is a program we created to give learners in all financial circumstances a chance to earn a Verified Certificate upon successful completion of an edX course.": "L'assistance financi\u00e8re edX est un programme que nous avons cr\u00e9\u00e9 pour donner aux apprenants de toute situation financi\u00e8re une chance d'obtenir une attestation apr\u00e8s la r\u00e9ussite d'un cours edX.", 
    "EdX doesn't have a timed transcript for this video in Studio, but we found a transcript on YouTube. You can import the YouTube transcript or upload your own .srt transcript file.": "EdX ne dispose pas de transcription synchronis\u00e9e pour cette vid\u00e9o dans Studio, mais il existe une transcription YouTube. Vous pouvez importer la transcription Youtube ou t\u00e9l\u00e9versez votre propre fichier de transcription srt.", 
    "EdX doesn\\'t have a timed transcript for this video. Please upload an .srt file.": "EdX ne dispose pas de transcription synchronis\u00e9e pour cette vid\u00e9o. Veuillez t\u00e9l\u00e9verser un fichier de transcription .srt.", 
    "EdX has a timed transcript for this video. If you want to edit this transcript, you can download, edit, and re-upload the existing transcript. If you want to replace this transcript, upload a new .srt transcript file.": "EdX dispose d'une transcription synchronis\u00e9e pour cette vid\u00e9o. Si vous souhaitez \u00e9diter cette transcription, vous pouvez t\u00e9l\u00e9charger, \u00e9diter, et r\u00e9-envoyer la transcription existante. Si vous souhaitez remplacer cette transcription, envoyez un nouveau fichier srt.", 
    "EdX has a timed transcript for this video. If you want to replace this transcript, upload a new .srt transcript file. If you want to edit this transcript, you can download, edit, and re-upload the existing transcript.": "EdX dispose d'une transcription synchronis\u00e9e pour cette vid\u00e9o. Si vous souhaitez remplacer cette transcription, envoyer un nouveau fichier de transcription srt. Si vous souhaitez \u00e9diter cette transcription, vous pouvez envoyer, \u00e9diter et re-r\u00e9envoyer la transcription existante.", 
    "EdX is committed to making it possible for you to take high quality courses from leading institutions regardless of your financial situation, earn a Verified Certificate, and share your success with others.": "EdX est d\u00e9termin\u00e9 \u00e0 vous rendre possible de suivre des cours de grande qualit\u00e9 en provenance d'institutions de premier plan quel que soit votre situation financi\u00e8re, obtenir une attestation et partager votre succ\u00e8s avec les autres.", 
