    "Enter the external login method students can use for the course.": "Entrez la m\u00e9thode de connexion externe que les \u00e9tudiants peuvent utiliser pour le cours", 
    "Enter the format for due dates. The default is Mon DD, YYYY. Enter \"%m-%d-%Y\" for MM-DD-YYYY, \"%d-%m-%Y\" for DD-MM-YYYY, \"%Y-%m-%d\" for YYYY-MM-DD, or \"%Y-%d-%m\" for YYYY-DD-MM.": "Entrer le format des dates de remises. Le d\u00e9faut est Mon DD, YYYY. Entrer \"%m-%d-%Y\" pour MM-DD-YYYY, \"%d-%m-%Y\" pour DD-MM-YYYY, \"%Y-%m-%d\" pour YYYY-MM-DD, ou \"%Y-%d-%m\" pour YYYY-DD-MM.", 
    "Enter the heading that you want students to see above your course handouts on the Course Home page. Your course handouts appear in the right panel of the page.": "Saisissez le titre que vous voulez que les \u00e9tudiants voient au dessus de vos documents de cours sur la page d'accueil du cours. Vos documents de cours apparaissent dans le panneau de droite de la page.", 
    "Enter the ids for the content groups this problem belongs to.": "Entrer les identifiants pour les groupes de contenu auxquels ce probl\u00e8me appartient.", 
    "Enter the location of the annotation storage server. The textannotation, videoannotation, and imageannotation advanced modules require this setting.": "Entrer l'emplacement du serveur de stockage d'annotations. Les modules avanc\u00e9s textannotation, videoannotation, et imageannotation requi\u00e8rent ce param\u00e8tre.", 
    "Enter the maximum number of students that can enroll in the course. To allow an unlimited number of students, enter null.": "Entrez le nombre maximal d'\u00e9tudiants qui peuvent s'inscrire au cours. Pour permettre \u00e0 un nombre illimit\u00e9 d'\u00e9tudiants, entrez la valeur null.", 
    "Enter the maximum number of times a student can try to answer problems. By default, Maximum Attempts is set to null, meaning that students have an unlimited number of attempts for problems. You can override this course-wide setting for individual problems. However, if the course-wide setting is a specific number, you cannot set the Maximum Attempts for individual problems to unlimited.": "Saisir le nombre maximum de tentatives de r\u00e9ponses qu'un \u00e9tudiant peut soumettre pour r\u00e9soudre un exercice. Par d\u00e9faut, le nombre \"maximum de tentatives\" est de z\u00e9ro, ce qui signifie que les \u00e9tudiants ont un nombre illimit\u00e9 de tentatives pour r\u00e9soudre les exercices. Vous pouvez surcharger ce param\u00e8tre de cours pour un exercice particulier. Cependant, si ce param\u00e8tre de cours est un nombre particulier, vous ne pouvez pas r\u00e9gler le nombre \"maximum de tentatives\"  \u00e0 l'infini pour un exercice en particulier.", 
    "Enter the method by which this course is edited (\"XML\" or \"Studio\").": "Saisissez la m\u00e9thode par laquelle ce cours est \u00e9dit\u00e9 (\"XML\" ou \"Studio\").", 
    "Enter the name of the cohort": "Entrer le nom de la cohorte", 
    "Enter the name of the course as it should appear in the edX.org course list.": "Entrez le nom du cours tel qu'il doit appara\u00eetre dans la liste des cours edX.org.", 
    "Enter the names of the advanced components to use in your library.": "Entrer les noms des composants avanc\u00e9s \u00e0 utiliser dans votre biblioth\u00e8que.", 
