    "Identify a video, 5-10 seconds in length, to play before course videos. Enter the video ID from the Video Uploads page and one or more transcript files in the following format: {format}. For example, an entry for a video with two transcripts looks like this: {example}": "Identifier un vid\u00e9o, d'une dur\u00e9e de 5-10 secondes, \u00e0 jouer avant les vid\u00e9os du cours. Entrer l'identifiant du vid\u00e9o de la page T\u00e9l\u00e9versements de vid\u00e9os et une ou plusieurs fichiers de transcriptions dans le format suivant : {format}. Par exemple, une entr\u00e9e pour une vid\u00e9o avec deux transcriptions ressemblerait \u00e0 ceci : {example}", 
