    "Sometimes the draft and published branches of a course can get out of sync. Force publish course command resets the published branch of a course to point to the draft branch, effectively force publishing the course. This view dry runs the force publish command": "Parfois, la branche du brouillon du cours et les branches publi\u00e9es d'un cours peuvent se d\u00e9synchroniser. La commande de publication forc\u00e9e d'un cours r\u00e9initialise la branche publi\u00e9e d'un cours pour pointer vers la branche du brouillon, ce qui force effectivement la publication du cours. Cette vue simule la commande de publication forc\u00e9e.", 
    "Sorry but you cannot have a root article with a slug.": "D\u00e9sol\u00e9, vous ne pouvez pas avoir un article racine avec un slug.", 
    "Sorry! Due to an error your purchase was charged for a different amount than the order total! The specific error message is: {error_message}. Your credit card has probably been charged. Contact us with payment-specific questions at {email}.": "D\u00e9sol\u00e9! D\u00fb \u00e0 une erreur votre commande a \u00e9t\u00e9 factur\u00e9e avec un montant diff\u00e9rent que le montant total de la commande! Le message d'erreur sp\u00e9cifique est: {error_message}. Votre carte de cr\u00e9dit a possiblement \u00e9t\u00e9 factur\u00e9e. Contacter nous avec vos questions de paiement \u00e0 {email}.", 
    "Sorry! Due to an error your purchase was charged for a different amount than the order total! The specific error message is: {msg}. Your credit card has probably been charged. Contact us with payment-specific questions at {email}.": "D\u00e9sol\u00e9 ! En raison d'une erreur votre achat a \u00e9t\u00e9 factur\u00e9 pour un montant diff\u00e9rent du montant total de la commande ! Le message d'erreur sp\u00e9cifique est: {msg}. Le montant a probablement \u00e9t\u00e9 pr\u00e9lev\u00e9 sur votre carte de cr\u00e9dit. Contactez-nous pour les questions li\u00e9es au paiement \u00e0 l'adresse {email}.", 
    "Sorry! Our payment processor did not accept your payment.  The decision they returned was {decision}, and the reason was {reason}.  You were not charged. Please try a different form of payment.  Contact us with payment-related questions at {email}.": "D\u00e9sol\u00e9! Notre serveur de paiement n'a pas accept\u00e9 votre paiement. La d\u00e9cision retourn\u00e9e \u00e9tait {decision}, et la raison invoqu\u00e9e \u00e9tait {reason}. Vous n'avez pas \u00e9t\u00e9 factur\u00e9. Veuillez essayer d'utiliser un autre mode de paiement. Contactez-nous pour des questions li\u00e9es au paiement \u00e0 l'adresse {email}.", 
    "Sorry! Our payment processor did not accept your payment. The decision they returned was {decision_text}, and the reason was {reason_text}. You were not charged. Please try a different form of payment. Contact us with payment-related questions at {email}.": "D\u00e9sol\u00e9! Notre processeur de paiement n'a pas accept\u00e9 votre paiement. La d\u00e9cision retourn\u00e9e etait {decision_text}, et la raison \u00e9tait {reason_text}. Vous n'avez pas \u00e9t\u00e9 factur\u00e9. S'il vous pla\u00eet essayer une forme de paiement diff\u00e9rentes. Contacter nous avec vos questions de paiement \u00e0 {email}.", 
    "Sorry! Our payment processor sent us back a corrupted message regarding your charge, so we are unable to validate that the message actually came from the payment processor. The specific error message is: {error_message}. We apologize that we cannot verify whether the charge went through and take further action on your order. Your credit card may possibly have been charged. Contact us with payment-specific questions at {email}.": "D\u00e9sol\u00e9! Notre processeur de paiement nous a retourn\u00e9 un message corrompu concernant votre facturation, alors nous somme dans l'impossibilit\u00e9 de valider que ce message provient bien de notre processeur de paiement. Le message d'erreur sp\u00e9cifique est: {error_message}. Nous nous excusons de ne pouvoir v\u00e9rifier que le paiement soit pass\u00e9 et prendre des actions suppl\u00e9mentaires pour votre commande. Votre carte de cr\u00e9dit a possiblement \u00e9t\u00e9 factur\u00e9e. Contacter nous avec vos questions de paiement \u00e0 {email}.", 
    "Sorry! Our payment processor sent us back a corrupted message regarding your charge, so we are unable to validate that the message actually came from the payment processor. The specific error message is: {msg}. We apologize that we cannot verify whether the charge went through and take further action on your order. Your credit card may possibly have been charged. Contact us with payment-specific questions at {email}.": "D\u00e9sol\u00e9! Notre processeur de paiement nous a renvoy\u00e9 un message corrompu au sujet de votre paiement, nous ne sommes donc pas en mesure de confirmer que le message provenait effectivement de notre processeur de paiement. Le message d'erreur sp\u00e9cifique est : {msg}. Veuillez nous excuser de ne pas pouvoir v\u00e9rifier si le r\u00e8glement est parvenu et de ne pas pouvoir traiter plus avant votre commande. Le montant peut \u00e9ventuellement avoir \u00e9t\u00e9 pr\u00e9lev\u00e9 sur votre carte de cr\u00e9dit. Contactez-nous pour les questions li\u00e9es au paiement \u00e0 l'adresse {email}.", 
    "Sorry! Our payment processor sent us back a message saying that you have cancelled this transaction. The items in your shopping cart will exist for future purchase. If you feel that this is in error, please contact us with payment-specific questions at {email}.": "D\u00e9sol\u00e9! Notre traitement des paiements nous a envoy\u00e9 un message disant que vous avez annul\u00e9 cette op\u00e9ration. Les articles de votre panier d'achat existeront lors d'un futur achat. Si vous pensez que ceci est une erreur, veuillez nous contacter \u00e0 propos de questions sp\u00e9cifiques paiement \u00e0 l'adresse {email}.", 
    "Sorry! Our payment processor sent us back a payment confirmation that had inconsistent data! We apologize that we cannot verify whether the charge went through and take further action on your order. The specific error message is: {msg} Your credit card may possibly have been charged.  Contact us with payment-specific questions at {email}.": "D\u00e9sol\u00e9 ! Notre processeur de paiement nous a renvoy\u00e9 une confirmation de paiement qui contenait des donn\u00e9es incoh\u00e9rentes ! Veuillez nous excuser de ne pas pouvoir v\u00e9rifier si le r\u00e8glement est parvenu et de ne pas pouvoir traiter plus avant votre commande. Le message d'erreur sp\u00e9cifique est : {msg} Le montant peut \u00e9ventuellement avoir \u00e9t\u00e9 pr\u00e9lev\u00e9 sur votre carte de cr\u00e9dit. Contactez-nous pour les questions li\u00e9es au paiement \u00e0 l'adresse {email}.", 
    "Sorry! Our payment processor sent us back a payment confirmation that had inconsistent data!We apologize that we cannot verify whether the charge went through and take further action on your order.The specific error message is: {error_message}. Your credit card may possibly have been charged. Contact us with payment-specific questions at {email}.": "D\u00e9sol\u00e9! Notre processeur de paiement nous a retourn\u00e9 une confirmation de paiement qui avait des donn\u00e9es incoh\u00e9rentes! Nous nous excusons de ne pouvoir v\u00e9rifier que le paiement soit pass\u00e9 et prendre des actions suppl\u00e9mentaires pour votre commande. Le message d'erreur sp\u00e9cifique est: {error_message}. Votre carte de cr\u00e9dit a possiblement \u00e9t\u00e9 factur\u00e9e. Contacter nous avec vos questions de paiement \u00e0 {email}.", 
    "Sorry! Your payment could not be processed because an unexpected exception occurred. Please contact us at {email} for assistance.": "D\u00e9sol\u00e9 ! Votre paiement n'a pas pu \u00eatre trait\u00e9 car une erreur inattendue s'est produite. Veuillez nous contacter \u00e0 l'adresse {email} pour recevoir de l'assistance.", 
