    "Specify a course title to use on the certificate if the course's official title is too long to be displayed well.": "Sp\u00e9cifier un titre de cours \u00e0 utiliser sur le certificat si le titre officiel du cours est trop long pour \u00eatre affich\u00e9.", 
    "Specify a minimum percentage score for an entrance exam before students can view your course content. Note, you must enable Entrance Exams for this course setting to take effect.": "Pr\u00e9ciser le score minimal en pourcentage que les \u00e9tudiants doivent obtenir avant de pouvoir acc\u00e9der au contenu du cours. Note : il vous faut activer l'examen d'entr\u00e9e pour que cette option soit prise en compte.", 
    "Specify a student to see all of that student's extensions.": "Choisissez un \u00e9tudiant pour voir toutes les extensions de cet \u00e9tudiant.", 
