    "Specify the default for how often variable values in a problem are randomized. This setting should be set to \"never\" unless you plan to provide a Python script to identify and randomize values in most of the problems in your course. Valid values are \"always\", \"onreset\", \"never\", and \"per_student\".": "Sp\u00e9cifie la valeur de d\u00e9faut de la fr\u00e9quence \u00e0 laquelle les valeurs des variables sont al\u00e9atoirement modifi\u00e9es. Ce param\u00e8tre devrait \u00eatre initialis\u00e9 \u00e0 \"never\" \u00e0 moins que vous planifiez de fournir un script Python qui identifierait et qui modifierait les valeurs al\u00e9atoirement pour la plupart des probl\u00e8mes dans votre cours. Les valeurs valides sont \"always\", \"onreset\", \"never\", et \"per_student\".", 
    "Specify the extension due date and time (in UTC; please specify {format_string}).": "Pr\u00e9cisez l'extension d'\u00e9ch\u00e9ance et l'heure (en heure UTC; merci d'utiliser le format {format_string}).", 
    "Specify the language of your course.": "Sp\u00e9cifier la langue de votre cours.", 
    "Specify the maximum team size and topics for teams inside the provided set of curly braces. Make sure that you enclose all of the sets of topic values within a set of square brackets, with a comma after the closing curly brace for each topic, and another comma after the closing square brackets. For example, to specify that teams should have a maximum of 5 participants and provide a list of 2 topics, enter the configuration in this format: {example_format}. In \"id\" values, the only supported special characters are underscore, hyphen, and period.": "Indiquer la taille maximum de l'\u00e9quipe et les sujets pour les \u00e9quipes \u00e0 l'int\u00e9rieur de la paire d'accolades fournies. Assurez-vous que vous joignez tous les jeux de valeurs de sujets au sein d'un paire de crochets, avec une virgule apr\u00e8s l'accolade fermant pour chaque sujet, et une autre virgule apr\u00e8s le crochet fermant. Par exemple, pour indiquer que les \u00e9quipes peuvent avoir au maximum 5 participants et fournir une liste de 2 sujets, entrer la configuration dans ce format: {example_format}. Dans les valeurs \"id\", les seuls caract\u00e8res sp\u00e9ciaux support\u00e9s sont soulignement, trait d'union, et point.", 
    "Specify the {platform_name} email address or username of a student here:": "Sp\u00e9cifiez l'adresse e-mail {platform_name} ou le nom d'utilisateur d'un \u00e9tudiant ici :", 
