    "Specify whether YouTube is available for the user.": "Indiquez si YouTube est disponible pour l'utilisateur.", 
    "Specify whether access to this video is limited to browsers only, or if it can be accessed from other applications including mobile apps.": "Sp\u00e9cifier si l'acc\u00e8s \u00e0 cette vid\u00e9o est limit\u00e9 aux navigateurs seulement, ou s'il peut \u00eatre acc\u00e9d\u00e9 \u00e0 partir d'autres applications incluant les applications mobiles.", 
    "Specify whether students must complete a survey before they can view your course content. If you set this value to true, you must add a name for the survey to the Course Survey Name setting above.": "Pr\u00e9ciser si les \u00e9tudiants doivent remplir une enqu\u00eate avant de pouvoir acc\u00e9der au contenu du cours. Si vous r\u00e9glez ce param\u00e8tre \u00e0 vrai, vous devez donner un nom \u00e0 l'enqu\u00eate dans le param\u00e8tre Nom de l'Enqu\u00eate du Cours ci-dessus.", 
