    "Use Reload Graphs to refresh the graphs.": "Utilisez Recharger les graphiques pour rafra\u00eechir les graphiques. ", 
    "Use a practice proctored exam to introduce learners to the proctoring tools and processes. Results of a practice exam do not affect a learner's grade.": "Utilisez un examen de pratique surveill\u00e9 afin d'introduire les apprenants au processus et aux outils de surveillance. Les r\u00e9sultats d'un examen de pratique ne comptent pas pour la note finale de l'\u00e9tudiant.", 
    "Use a timed exam to limit the time learners can spend on problems in this subsection. Learners must submit answers before the time expires. You can allow additional time for individual learners through the Instructor Dashboard.": "Utiliser un examen minut\u00e9 pour limiter le temps allou\u00e9 aux participants pour r\u00e9pondre aux exercices de cette sous-section. Les participants doivent soumettre leurs r\u00e9ponses avant la fin du temps allou\u00e9. Vous pouvez allouer du temps suppl\u00e9mentaire \u00e0 des participant depuis l'onglet Enseignant.", 
    "Use an archive program to extract the data from the .tar.gz file. Extracted data includes the course.xml file, as well as subfolders that contain course content.": "Utilisez un logiciel de manipulation d'archives pour extraire les donn\u00e9es du fichier .tar.gz. Les donn\u00e9es extraites contiennent le fichier course.xml ainsi que les sous dossiers qui contiennent le contenu du cours.", 
    "Use an archive program to extract the data from the .tar.gz file. Extracted data includes the library.xml file, as well as subfolders that contain library content.": "Utilisez un logiciel de manipulation d'archives pour extraire les donn\u00e9es du fichier .tar.gz. Les donn\u00e9es extraites contiennent le fichier library.xml ainsi que les sous dossiers qui contiennent le contenu du cours.", 
    "Use as a Prerequisite": "Utilis\u00e9 comme Pr\u00e9-requis", 
    "Use between 250 and 500 words or so in your response.": "Utiliser entre 250 et 500 mots environ dans votre r\u00e9ponse.", 
    "Use content groups to give groups of students access to a specific set of course content. Create one or more content groups, and make specific components visible to them.": "Utilisez les groupes de contenu afin de donner \u00e0 des groupes d'\u00e9tudiants acc\u00e8s \u00e0 du contenu de cours sp\u00e9cifique. Cr\u00e9er un ou plusieurs groupes de contenu, et cr\u00e9er des composants sp\u00e9cifiques visibles pour ceux-ci.", 
    "Use course updates to notify students of important dates or exams, highlight particular discussions in the forums, announce schedule changes, and respond to student questions. You add or edit updates in HTML.": "Utilisez les mises \u00e0 jours des cours pour pr\u00e9venir les \u00e9tudiants des dates importantes comme les examens, pour mettre en \u00e9vidence des discussions particuli\u00e8res dans les forums, pour annoncer des changements dans l'horaire et pour r\u00e9pondre aux questions des \u00e9tudiants. Vous pouvez ajouter ou \u00e9diter les mises \u00e0 jour en HTML.", 
    "Use experiment group configurations if you are conducting content experiments, also known as A/B testing, in your course. Experiment group configurations define how many groups of students are in a content experiment. When you create a content experiment for a course, you select the group configuration to use.": "Utilisez les configurations de groupe de test de contenu si vous faites des tests, aussi connu sous test A/B, dans votre cours. Les configurations de test de contenu d\u00e9finissent combien de groupes d'\u00e9tudiants sont dans un test de contenu. Quand vous cr\u00e9ez un test de contenu pour un cours, vous s\u00e9lectionnes la configuration de groupe \u00e0 essayer.", 
    "Use library content in courses by adding the {em_start}library_content{em_end} policy key to the Advanced Module List in the course's Advanced Settings, then adding a Randomized Content Block to your courseware. In the settings for each Randomized Content Block, select this library as the source library, and specify the number of problems to be randomly selected and displayed to each student.": "Utilisez le contenu de la biblioth\u00e8que dans les cours en ajoutant la cl\u00e9 de politique {em_start}library_content{em_end} dans la liste des modules avanc\u00e9s dans les param\u00e8tres avanc\u00e9s du cours, et ensuite en ajoutant un bloc de contenu al\u00e9atoire \u00e0 votre cours. Dans les param\u00e8tres pour chaque bloc de contenu al\u00e9atoire, s\u00e9lectionnez cette biblioth\u00e8que comme la biblioth\u00e8que source, et sp\u00e9cifier le nombre de probl\u00e8mes \u00e0 \u00eatre al\u00e9atoirement s\u00e9lectionn\u00e9s et affich\u00e9s \u00e0 chaque \u00e9tudiant.", 
    "Use my institution/campus credentials": "Utiliser mes informations institution/campus", 
    "Use parentheses () to make expressions clear. You can use parentheses inside other parentheses.": "Utilisez les parenth\u00e8ses () pour clarifier vos expressions. Vous pouvez utiliser des parenth\u00e8ses au sein d'autres parenth\u00e8ses.", 
    "Use the All Topics menu to find specific topics.": "Utilisez le menu 'Tous les sujets' pour trouver un sujet sp\u00e9cific", 
    "Use the Discussion Topics menu to find specific topics.": "Utiliser le menu pour trouver un sujet en particulier.", 
    "Use the Sailthru content API to fetch course tags.": "Utiliser l'API de contenu Sailthru pour obtenir les tags de cours.", 
    "Use the arrow keys to navigate the tips or use the tab key to return to the calculator": "Utiliser les fl\u00e8ches pour naviguer aux travers des astuces ou utiliser la touche TAB pour retourner \u00e0 la calculatrice", 
    "Use the checkout page hosted by the E-Commerce service.": "Utiliser la page de paiement h\u00e9berg\u00e9 par le service de commerce \u00e9lectronique.", 
    "Use the retake photo button if you are not pleased with your photo": "Utilisez le bouton reprendre photo si vous n'\u00eates pas satisfait de votre photo", 
    "Use the {em_start}Web URL{em_end} value to reference the file or image only from outside of your course. {em_start}Note:{em_end} If you lock a file, the Web URL no longer works for external access to a file.": "Utilisez la valeur du {em_start}URL Web{em_end} afin de faire r\u00e9f\u00e9rence \u00e0 un fichier ou une image uniquement \u00e0 l'ext\u00e9rieur de votre cours. {em_start}Note : {em_end} Si vous verrouillez un fichier, le URL Web ne fonctionnera plus pour l'acc\u00e8s externe \u00e0 un fichier.", 
    "Use the {em_start}{studio_name} URL{em_end} value to link to the file or image from a component, a course update, or a course handout.": "Utilisez la valeur de {em_start}l'URL {studio_name}{em_end} pour cr\u00e9er un lien depuis le fichier ou l'image d'un composant, une mise \u00e0 jour du cours, ou le syllabus.", 
    "Use this setting only when generating PDF certificates. Between quotation marks, enter the long name of the type of certificate that students receive when they complete the course. For instance, \"Certificate of Achievement\".": "Utilisez ce param\u00e8tre seulement quand vous g\u00e9n\u00e9rez des certificats PDF. Entre guillemets, entrez le nom long du cours qui sera utilis\u00e9 sur le certificat que les \u00e9tudiants recevront quand ils auront compl\u00e9t\u00e9 le cours.", 
    "Use this setting only when generating PDF certificates. Between quotation marks, enter the short name of the type of certificate that students receive when they complete the course. For instance, \"Certificate\".": "Utilisez ce param\u00e8tre seulement quand vous g\u00e9n\u00e9rez des certificats PDF. Entre guillemets, entrez le nom court du cours qui sera utilis\u00e9 sur le certificat que les \u00e9tudiants recevront quand ils auront compl\u00e9t\u00e9 le cours.", 
    "Use this to export your course to its git repository.": "Utiliser ceci pour exporter votre cours ver son d\u00e9p\u00f4t git", 
