    "We are sorry. Our course staff did not approve your request to change your name from {old_name} to {new_name}. If you need further assistance, please e-mail the course staff at {email}.": "Nous sommes d\u00e9sol\u00e9s. L'\u00e9quipe p\u00e9dagogique n'a pas approuv\u00e9 votre demande de changement de nom de {old_name} \u00e0 {new_name}. Si vous avez besoin d'aide, vous pouvez contacter l'\u00e9quipe p\u00e9dagogique \u00e0 {email}.", 
    "We ask you to activate your account to ensure it is really you creating the account and to prevent fraud.": "Nous vous demandons d'activer votre compte pour nous assurer que c'est bien vous qui cr\u00e9er le compte et afin de pr\u00e9venir la fraude.", 
    "We cannot find a certificate with this URL or ID number. If you are trying to validate a certificate, make sure that the URL or ID number is correct. If you are sure that the URL or ID number is correct, contact support.": "Nous ne pouvons pas trouver un certificat avec cette URL ou cet identifiant. Si vous essayez de valider un certificat, assurez vous que l'URL ou l'identifiant soient corrects. Si vous \u00eates s\u00fbr de vos valeurs d'URL ou d'identifiant, contactez le support.", 
