    "We could not verify your identity for the {assessment} assessment in the {course_name} course. You have used {used_attempts} out of {allowed_attempts} attempts to verify your identity.": "Nous n'avons pas pu v\u00e9rifier votre identit\u00e9 pour l'\u00e9valuation {assessment} du cours {course_name}. Vous avez utilis\u00e9 {used_attempts} des {allowed_attempts} tentatives pour v\u00e9rifier votre identit\u00e9.", 
    "We couldn't create your account.": "Nous n'avons pas pu cr\u00e9er votre compte.", 
