    "You cannot delete this article because you do not have permission to delete articles with children. Try to remove the children manually one-by-one.": "Vous ne pouvez pas supprimer cet article car vous n'avez pas la permission d'effacer des articles ayant des articles enfants. Essayez d'abord de supprimer les articles enfants manuellement, un par un.", 
